INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 1, 1.47, "2023/09/22 14:59:59", "クローチェ", 10001, 2, 1, 2002, "2023/06/30 12:00:00", 126401, 0.0, 1, "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 1, 2.15, "2023/09/22 14:59:59", "クローチェ", 10002, 1, 2, 2002, "2023/06/30 12:00:00", 126401, 0.0, 2, "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 1, 0.0, "2023/09/22 14:59:59", "ライラエル", 10003, 2, 2, 2002, "2023/06/30 12:00:00", 126501, 0.0, 1, "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 1, 0.0, "2023/09/22 14:59:59", "ライラエル", 10004, 1, 1, 2002, "2023/06/30 12:00:00", 126501, 0.0, 2, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 2, 0.0, "2023/12/22 14:59:59", "リンド", 10005, 2, 2, 2002, "2023/09/15 15:00:00", 127702, 0.0, 1, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 2, 0.0, "2023/12/22 14:59:59", "リンド", 10006, 2, 2, 2002, "2023/09/15 15:00:00", 127702, 0.0, 2, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 2, 0.0, "2023/12/22 14:59:59", "ヴルム", 10007, 1, 1, 2002, "2023/09/15 15:00:00", 127802, 0.0, 1, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 2, 6.5, "2023/12/22 14:59:59", "ヴルム", 10008, 1, 2, 2002, "2023/09/15 15:00:00", 127802, 0.0, 2, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 3, 0.0, "2024/03/22 14:59:59", "アネモネ", 10009, 1, 2, 2002, "2023/12/15 15:00:00", 129602, 0.0, 1, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 3, 0.0, "2024/03/22 14:59:59", "アネモネ", 10010, 1, 2, 2002, "2023/12/15 15:00:00", 129602, 0.0, 2, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 3, 0.0, "2024/03/22 14:59:59", "ネフィ=ネラ", 10011, 1, 1, 2002, "2023/12/15 15:00:00", 129701, 0.0, 1, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 3, 6.2, "2024/03/22 14:59:59", "ネフィ=ネラ", 10012, 1, 2, 2002, "2023/12/15 15:00:00", 129701, 0.0, 2, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 4, 3.1, "2024/06/22 14:59:59", "カノン", 10013, 5, 3, 2002, "2024/03/15 15:00:00", 130301, 0.0, 1, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 4, 6.15, "2024/06/22 14:59:59", "カノン", 10014, 2, 3, 2002, "2024/03/15 15:00:00", 130301, 0.0, 2, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 4, 0.0, "2024/06/22 14:59:59", "ナーナ", 10015, 2, 2, 2002, "2024/03/15 15:00:00", 130401, 0.0, 1, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 4, 3.35, "2024/06/22 14:59:59", "ナーナ", 10016, 1, 2, 2002, "2024/03/15 15:00:00", 130401, 0.0, 2, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 5, 0.0, "2024/09/22 14:59:59", "ホウオウ", 10017, 1, 1, 2002, "2024/06/15 15:00:00", 130502, 0.0, 1, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 5, 3.18, "2024/09/22 14:59:59", "ホウオウ", 10018, 1, 2, 2002, "2024/06/15 15:00:00", 130502, 0.0, 2, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 5, 0.0, "2024/09/22 14:59:59", "ホウオウ", 10019, 4, 4, 2002, "2024/06/15 15:00:00", 130503, 0.0, 3, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 5, 4.9, "2024/09/22 14:59:59", "ネア", 10020, 2, 1, 2002, "2024/06/15 15:00:00", 123301, 0.0, 1, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 5, 4.8, "2024/09/22 14:59:59", "ネア", 10021, 2, 1, 2002, "2024/06/15 15:00:00", 123301, 0.0, 2, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 6, 4.922, "2024/12/22 14:59:59", "カリザ", 10022, 1, 3, 2002, "2024/09/15 15:00:00", 133301, 0.0, 1, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 6, 9.638, "2024/12/22 14:59:59", "カリザ", 10023, 5, 3, 2002, "2024/09/15 15:00:00", 133301, 0.0, 2, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 6, 2.88, "2024/12/22 14:59:59", "ミーア", 10024, 2, 1, 2002, "2024/09/15 15:00:00", 133401, 0.0, 1, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 6, 4.818, "2024/12/22 14:59:59", "ミーア", 10025, 1, 5, 2002, "2024/09/15 15:00:00", 133401, 0.0, 2, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 7, 1.78, "2025/03/22 14:59:59", "グレイス", 10026, 1, 2, 2002, "2024/12/15 15:00:00", 133002, 0.0, 1, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 7, 6.15, "2025/03/22 14:59:59", "グレイス", 10027, 7, 1, 2002, "2024/12/15 15:00:00", 133002, 0.0, 2, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 7, 4.28, "2025/03/22 14:59:59", "ヴァイオレット", 10028, 2, 6, 2002, "2024/12/15 15:00:00", 133102, 0.0, 1, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 7, 0.0, "2025/03/22 14:59:59", "ヴァイオレット", 10029, 1, 1, 2002, "2024/12/15 15:00:00", 133102, 0.0, 2, "じめじめした商品は\nございませんので\n安心してお買い求め下さい");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 8, 5.53, "2025/06/23 14:59:59", "ルルィ", 10030, 1, 2, 2002, "2025/03/15 15:00:00", 136902, 0.0, 1, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 8, 6.05, "2025/06/23 14:59:59", "ルルィ", 10031, 7, 9, 2002, "2025/03/15 15:00:00", 136902, 0.0, 2, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 8, 0.0, "2025/06/23 14:59:59", "デュラン", 10032, 1, 2, 2002, "2025/03/15 15:00:00", 137001, 0.0, 1, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 8, 0.0, "2025/06/23 14:59:59", "デュラン", 10033, 1, 2, 2002, "2025/03/15 15:00:00", 137001, 0.0, 2, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 9, 0.0, "2025/09/23 14:59:59", "サツキ", 10034, 2, 2, 2002, "2025/06/16 15:00:00", 135902, 0.0, 1, "おう\n好きなもん持ってきな");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 9, 4.935, "2025/09/23 14:59:59", "サツキ", 10035, 6, 1, 2002, "2025/06/16 15:00:00", 135902, 0.0, 2, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 9, 7.441, "2025/09/23 14:59:59", "ユキノ", 10036, 5, 2, 2002, "2025/06/16 15:00:00", 135802, 0.0, 1, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 9, 0.0, "2025/09/23 14:59:59", "ユキノ", 10037, 7, 7, 2002, "2025/06/16 15:00:00", 135802, 0.0, 2, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 10, 2.295, "2025/12/23 14:59:59", "クルル", 10038, 2, 2, 2002, "2025/09/16 15:00:00", 130901, 0.0, 1, "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 10, 6.281, "2025/12/23 14:59:59", "クルル", 10039, 6, 1, 2002, "2025/09/16 15:00:00", 130901, 0.0, 2, "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 10, 5.549, "2025/12/23 14:59:59", "ヴォルガーノ", 10040, 1, 2, 2002, "2025/09/16 15:00:00", 137701, 0.0, 1, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (-470.0, 10, 2.64, "2025/12/23 14:59:59", "ヴォルガーノ", 10041, 6, 3, 2002, "2025/09/16 15:00:00", 137701, 0.0, 2, "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！");
